import React from 'react'
import styles from '../c_iphone-14-2.module.css';
import bg2 from "../assets2/bg2.png";
import card from "../assets2/card.png";
import grouptext from "../assets2/grouptext.png";
import line from "../assets2/line.png";

const Login = () => {
  return (
        <div className={styles['frame']}>
          <img
            src={bg2}
            alt="rectangle"
            width={390}
            height={844}
            className={styles['rectangle']}
            />
         
          <div className={styles['text']}>
            <p className={styles['text1']}>Selamat Datang !</p>
          </div>
          <img
            src={line}
            alt="line"
            width={110}
            height={1.0000152587890625}
            className={styles['line']}
            />
          <div className={styles['text2']}>
            <p className={styles['text3']}>Login</p>
          </div>
        </div>
      )
    }

export default Login
